import './App.css';
import React from "react";
import { Navbar, NavDropdown, Container } from 'react-bootstrap';
import CustomizeNavBar from './components/nav-bar';
import { FashionBox, HandleClickFashionBox } from './components/fashion-box/fashion-box-redux';
import ChatBox from './components/chat-box/chat-box';


function App() {

    return (
        <body>
            <CustomizeNavBar />
            <div className='store-container'>
                <div className='buy-box'>
                    <FashionBox
                        boxName='時尚隨機箱'
                        price='300'
                        discountPrice='270'
                    />
                </div>
                <div className='buy-box'>
                    <HandleClickFashionBox 
                        boxName='時尚隨機箱'
                    />
                </div>
                <div className='chat-box'>
                    <ChatBox />
                </div>

            </div>
            <div className="footer">
                Copyright © yiru1218. All rights reserved.
                <br></br>
                圖片皆取自於<a href='http://www.gametsg.com/maplestory/'>新楓之谷透視鏡</a>
            </div>

        </body>
    )
}

export default App;
